  @Input() task: Task;

  @Output()
  onPinTask = new EventEmitter<Event>();

  @Output()
  onArchiveTask = new EventEmitter<Event>();

  constructor() { }

  onPin(id: string) {
    this.onPinTask.emit(id as any);
  }

  onArchive(id: string) {
    this.onArchiveTask.emit(id as any);
  }
}

